        5: "...Wachsen und Reifen sind ein Teil des ewigen Kreislaufs und der nat\xFCrlichste Teil des Lebens. Zerst\xF6rung nur um ihrerer selbst Willen und etwas dem Boden gleich zu machen, ohne anderes aufzubauen, sind ein Greuel. Lasse keinen Tag verstreichen, an dem du nicht etwas Lebendem geholfen h\xE4ttest, zu gedeihen. Du sollst Pflanzen hegen, pflegen und anpflanzen, wann immer dir das m\xF6glich ist. Sch\xFCtze die B\xE4ume und die Pflanzen und bewahre ihre Samen, so dass, was zerst\xF6rt wurde, an anderer Stelle einen neuen Platz finden kann. Sorge f\xFCr die Fruchtbarkeit der Erde, aber \xFCberlasse die Fruchtbarkeit der Menschen sich selber. Halte dich vom Feuer fern. Mindestens einmal alle zehn Tage sollst du einen Samen setzen oder eine kleine Pflanze pflanzen...\n\n\
